import React from "react";
import Narbar from 'Components/Narbar/Narbar';

const Home = ({user}) => {
  console.log(user);
  return (
    <div>
        <Narbar></Narbar>
      <h1 className>Home - {user.email}</h1>
    </div>
  );
};

export default Home;
